import Navigation from '../components/Navigation';
import ParametresBanner from '../components/ParametresBanner';

const Contact = () => {
    return (
        <div className="contact">
            <Navigation/>
            <ParametresBanner/>
            <div className="container">
                <h2>Contact</h2>
            </div>
        </div>

    );
};

export default Contact;
